import styled from 'styled-components';

const MenuContainer = styled.div`
    height: 100vh;
    width: 100vw;
    .fixed;
    .top-0;
    .left-0;
    .bg-opacity-10;
    .bg-black;
`;

const SideMenu = () => {
    return (
        <MenuContainer>

        </MenuContainer>
    );  
}

export default SideMenu;
